import React, { Component } from 'react'

class Welcome extends Component {
  render() {
    return (
      <div className="enter-screen">
        <form className="enter-form">
          <h3>Enter your username</h3>
          <input type="text"/>
        </form>
      </div>
    )
  }
}

export default Welcome;
